    table_rows = eval(table['rows'])
    buildings_in_OP = [row for row in table_rows if row[6] == "Overland Park"]
    filtered_buildings = []
    for building in buildings_in_OP:
        height_units = int(building[3].split(" ")[0].replace("(", "").replace(")", ""))
        if 216 <= height_units <= 385:
            filtered_buildings.append(int(building[4]))
    if len(filtered_buildings) > 0:
        data_dict = {
            'Count': len(filtered_buildings),
            'Min': min(filtered_buildings),
            'Max': max(filtered_buildings),
            'Avg': sum(filtered_buildings) / len(filtered_buildings)
        }
        return str(data_dict)
    else:
        return str(None)
